import React, { Component } from 'react';
import ReactTable from "react-table";
import logo from './logo.svg';
import './App.css';

const data = [{
  name: 'Roy Agasthyan',
  age: 26
},{
  name: 'Sam Thomason',
  age: 22
},{
  name: 'Michael Jackson',
  age: 36
},{
  name: 'Samuel Roy',
  age: 56
},{
  name: 'Rima Soy',
  age: 28
},{
  name: 'Suzi Eliamma',
  age: 28
}]

class App extends Component {
  render() {
    return (
      <div className="App">
       <ReactTable data={data}/>>

      </div>
    );
  }
}

export default App;
